import React from 'react';
import { Card, Row, Col } from 'antd';

const Projects = () => {
  return (
    <div className="projects-page">
      <h1>My Projects</h1>
      <Row gutter={16}>
        <Col span={8}>
          <Card title="Project 1">
            Description of project 1
          </Card>
        </Col>
        <Col span={8}>
          <Card title="Project 2">
            Description of project 2
          </Card>
        </Col>
      </Row>
    </div>
  );
};

export default Projects;
